import React from "react";

export default function TodoList() {
  return (
    <header>
      <div>
        <span>Julian van Beek</span>
        <span>Web Designer</span>
      </div>
      <ul>
        <li><a href='#'>Home</a></li>
        <li><a href='#'>Work</a></li>
        <li><a href='#'>About me</a></li>
        <li><a href='#'>Contact</a></li>
      </ul>
    </header>
  );
}

const styles = {
  headerStyles: {
    backgroundColor: '#111'
  }
}
